// App.js

import React, { useState } from 'react';
import './App.css';

function App() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [newUsername, setNewUsername] = useState('');
  const [newPassword, setNewPassword] = useState('');
  const [newUserRole, setNewUserRole] = useState('');
  const [newProductName, setNewProductName] = useState('');
  const [newProductPrice, setNewProductPrice] = useState('');

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ username, password }),
      });
      const data = await response.json();
      setMessage(data.message);

      if (data.user && data.user.role === 'admin') {
        setIsLoggedIn(true);
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const handleCreateUser = async () => {
    try {
      const response = await fetch('http://localhost:5000/create-user', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ username: newUsername, password: newPassword, role: newUserRole }),
      });
      const data = await response.json();
      console.log(data.message);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const handleCreateProduct = async () => {
    try {
      const response = await fetch('http://localhost:5000/create-product', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ name: newProductName, price: newProductPrice }),
      });
      const data = await response.json();
      console.log(data.message);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div className="App">
      {isLoggedIn ? (
        <div>
          <h1>Welcome Admin!</h1>
          <div>
            <h2>Create User</h2>
            <form onSubmit={handleCreateUser}>
              <label>
                Username:
                <input type="text" value={newUsername} onChange={(e) => setNewUsername(e.target.value)} />
              </label>
              <label>
                Password:
                <input type="password" value={newPassword} onChange={(e) => setNewPassword(e.target.value)} />
              </label>
              <label>
                Role:
                <select value={newUserRole} onChange={(e) => setNewUserRole(e.target.value)}>
                  <option value="admin">Admin</option>
                  <option value="cocina">Cocina</option>
                  <option value="mesero">Mesero</option>
                </select>
              </label>
              <button type="submit">Create User</button>
            </form>
          </div>
          <div>
            <h2>Create Product</h2>
            <form onSubmit={handleCreateProduct}>
              <label>
                Product Name:
                <input type="text" value={newProductName} onChange={(e) => setNewProductName(e.target.value)} />
              </label>
              <label>
                Price:
                <input type="number" value={newProductPrice} onChange={(e) => setNewProductPrice(e.target.value)} />
              </label>
              <button type="submit">Create Product</button>
            </form>
          </div>
        </div>
      ) : (
        <form onSubmit={handleLogin}>
          <label>
            Username:
            <input type="text" value={username} onChange={(e) => setUsername(e.target.value)} />
          </label>
          <label>
            Password:
            <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
          </label>
          <button type="submit">Login</button>
        </form>
      )}
      <p>{message}</p>
    </div>
  );
}

export default App;
